import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <h1>Hello World</h1>
  }
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

    <App/>
);
